import React from "react";
import styles from "../styles/Header.module.css";

function Header() {
  return (
    <div className={styles.header}>
      <span className={styles.title}>
        <h2>Musimu</h2>
      </span>
      <div className={styles.navbar}>navbar</div>
    </div>
  );
}

export default Header;
